import {
  container,
  title,
  whiteColor,
  section,
} from "assets/jss/material-kit-pro-react.js";

const notificationsStyles = {
  section: {
    backgroundColor: whiteColor,
    display: "block",
    width: "100%",
    position: "relative",
    padding: "70px 0",
    ...section,
  },
  title: {
    ...title,
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none",
  },
  space70: {
    height: "70px",
    display: "block",
  },
  container,
};

export default notificationsStyles;
